import {AbstractCar, AbstractEngine, FamilyCar} from '../models/index'

/*

    context waar auto's in kunnen worden opgeslagen

*/

interface CarContext {
    car?: AbstractCar;
}

const context: CarContext = {
    car: undefined
}


/** Stap 1: selecteer een auto */
context.car = new FamilyCar();


export const WorkingWithClasses = (props: AbstractEngine) =>{
    return(
        <div>
  <h1>{props.fuelType}</h1>
        </div>
    )

}
export default WorkingWithClasses;
